import React, { Component } from "react";
import "./weather.css";

class Temperature extends Component {
  state = {};
  render() {
    return (
      <div>
        <span className="fadeIn">{Math.round(this.props.weather.temp)}</span>
      </div>
    );
  }
}

export default Temperature;
